module.exports = "<div id=\"add-animation\" class=\"about profile\">\r\n  <header class=\"heading\"><span class=\"heading__text\">College Profile</span></header>\r\n  <img src=\"../../../../assets/images/bpit1.jpg\" alt=\"\" class=\"people-image center-h\">\r\n  <p id=\"text-content\">In view of the national and international scenario of the growing demand of qualified technical personnel in different streams of engineering technology and management, Bhartiya Brahmin Charitable Trust in 2005 laid the foundation of Bhagwan Parshuram Institute of Technology (BPIT). BPIT is approved by the Ministry of Human Resource Development, Government of India and the Directorate of Training and Technical Education, Government of National Capital Territory, Delhi. It is affiliated to Guru Gobind Singh Indraprastha University, Delhi and offers courses of Bachelor of Technology (B.Tech) and Master of Business Administration (MBA), which are approved by the All India Council of Technical Education (AICTE).</p>\r\n  <p id=\"text-content\">The institute is situated at a prime location on Dr. K.N. Katju Marg, which separates Sector 11 and Sector 17 in Rohini, North Delhi. Adjacent to BPIT is the MCD Building, which houses Railway Reservation Centre. It is well connected with public transport system like DTC buses and metro shuttles. Rithala metro station on metro line 1 at distances of 1.5 and the Jahangirpuri metro station near Mukarba chowk (crossing of GT road to Karnal and outer ring road) on metro line 2 are at 4 km, respectively.</p>\r\n  <blockquote style=\"background:#f1f1f1; border-left:7px solid red;border-radius:3px;\">\r\n\t\t\t\tBPIT is a pioneer Institute providing education to the students of delhi and outside delhi in the field of engineering and management since more than a decade. BPIT is the only self financing institute affiliated to GGSIP University whose all UG engineering programs (B.Tech. CSE/IT/ ECE / EEE) are accredited by NBA (National Board of Accreditation) which in itself certifies the quality policy and standards followed in BPIT.  All the labs in BPIT are well equipped. The fully dedicated placement team of BPIT has assured the placement of BPIT students in reputed companies such as amazon, zomato, Virtusa, ByJuY’s, LibSys, IBM, Samsung, Motherson Sumi, Sopera Steria and many more. BPIT is spread in an area of about 5.7 acres and has four storey building of academic and office complex with lifts. A girl student's Hostel having 64 double occupancy rooms, with all modern amenities has been constructed and furnished.\r\n\t\t\t</blockquote>\r\n  <p id=\"text-content\">BPIT is spread in an area of about 5.7 acres and has four storey building of academic and office complex with lifts. A girl student's Hostel having 64 double occupancy rooms, with all modern amenities has been constructed and furnished and it will be functional from the session 2011-12.</p>\r\n  <p id=\"text-content\">There are well equipped spacious classrooms, drawing halls, laboratories, workshops and conference/seminar halls. A well stacked large library having state of art facilities has been developed. Laboratories and workshops have the best quality of equipments commensurate with the requirements of the curriculum of IP University and beyond. There are eight computer laboratories, each equipped with the required number of computers, having latest hardware configuration and the latest software's. All the computers are networked through formatted LAN. Wi-Fi connectivity with a high speed RF link of 2 Mbps provide excellent internet facility in the entire campus.</p>\r\n  <p id=\"text-content\">BPIT strives to provide accurate learning and industry oriented culture by means of its enriched practical training programs for the students in different courses offered in different semesters. The students in second and third year are offered in-house training facilities in the fields like Computers, Networking, Computer Applications, Internet Technologies, Electronic Hardware Design, Simulation and Analysis etc.</p><br><br><br>\r\n</div>\r\n"

