module.exports = "<div id=\"add-animation\">\r\n  <header class=\"heading\"><span class=\"heading__text\">Trust</span></header>\r\n  <div class=\"trust\">\r\n  <img src=\"../../../../assets/images/trust1.jpg\" alt=\"\" class=\"people-image center-h trust__pic\">\r\n  <p id=\"text-content\">Bhagwan Parshuram Institute of Technology (BPIT) has been promoted by the Bhartiya Bhrahman Charitable Trust, which was established in year 1974. The members of the trust are from various walks of life including many educationalist, industrialist, businessmen, architects, engineers, other professionals and also some philanthropists.</p>\r\n  <p id=\"text-content\">The trust is constantly involved in number of charitable programmes including professional education, health and upliftment of poor. Industrialist Shri Atam Prakash Kaushik, who is actively involved with the trust since its inception. He is also the President of the trust and Chairman of BPIT.</p>\r\n  </div>\r\n\r\n  <div class=\"trust\">\r\n    <header class=\"trust__heading\">The Chairman</header>\r\n    <img src=\"../../../../assets/images/trust3.png\" class=\"people-image center-h trust__pic\" alt=\"\">\r\n    <p id=\"text-content\">\r\n      <b>Sh. Atam Prakash Kaushik</b> is the President of Bhartiya Brahmin Charitable Trust (BBCT) and also the founder Chairman of Bhagwan Parshuram Institute of Technology (founded by BBCT in 2005). He is one of the five members, who formed the Bhartiya Brahmin Charitable Trust (BBCT) about 38 years ago. He is an industrialist by profession and philanthropist by nature. BBCT is the only charitable trust of Brahmins in the country and has about 380 trustees from various professions. The trust is constantly involved in a number of charitable programmes including professional education, health and upliftment of the poor. He is also a trustee of the Maharaja Agarsen Hospital and an Associate Member of Sant Parmanand Hospital. He holds several important honorary offices like: the Chairman of Hindustan Mercantile Association Dispute Committee; Member of Managing Committee of internationally known Shri Gauri Shankar Temple, Chandni Chowk; Member of Managing Committee of Sanskrit Vidhalaya, Ram Dal, Dariba; etc. For many years he has also remained President of Janta College Bawal (Haryana).\r\n    </p>\r\n  </div>\r\n\r\n  <div class=\"trust\">  \r\n    <header class=\"trust__heading\">The General Secretary</header>\r\n    <img src=\"../../../../assets/images/trust4.jpg\" class=\"people-image center-h trust__pic\" alt=\"\">\r\n    <p id=\"text-content\">\r\n      <b>Shri Vinod Vats</b> is the General Secretary of Bhagwan Parshuram Institute of Technology and also the General Secretary of Bhartiya Brahmin Trust since 1990. He plays a vital role in the development of the institute. He also plays a key role in the organization and management of various social functions and samagams in North Delhi as a prominent active social worker. Being an active social worker, he has been holding many honorary offices. Few of these are: President of the Disciplinary Committee of Gaur Vidya Pracharini Sabah; Member of the Advisory Committee of Deen Dayal Upadhyaya Hospital, Government of NCT of Delhi; Member of AD Hoc Committee of Technical Institutes in Delhi; Member of Gaur Brahmin College of Education, Rohtak; Member of Tika Ram Shiksha Sansthan, Sonepat; etc.\r\n    </p>\r\n  </div>\r\n\r\n  <div class=\"trust\">  \r\n    <header class=\"trust__heading\">Secretary</header>    \r\n    <img src=\"../../../../assets/images/trust5.JPG\" class=\"people-image center-h trust__pic\" alt=\"\">\r\n    <p id=\"text-content\">\r\n      <b>Shri B.N. Sharma</b> is the Secretary of Bhagwan Parshuran Institute of Technology as well as Bhartiya Brahmin Charitable Trust. Being a good scholar, he has keenness for leadership which he demonstrated through students union in his college days in Calcutta. He is a successful businessman and an industrialist in the field of alloy steel in the country. He plays an important role in the management of this Institute. He is an active social worker and also the founder member and President of Pracheen Sanathan Dharam Sabah (Regd.), which was established in 1970. Because of his efforts and dedication, the Prachin Sanathan Dharam in 2002 dedicated the Shri Ram Jaanki Mandir in Sainik Vihar to the society. Being an industrialist, he has keen interest in the engineering and management education. He is actively involved in the overall development of the institute.\r\n    </p>\r\n  </div>\r\n\r\n  <div class=\"trust\">  \r\n    <header class=\"trust__heading\">Vice President</header>    \r\n    <img src=\"../../../../assets/images/trust6.jpg\" class=\"people-image center-h trust__pic\" alt=\"\">\r\n    <p id=\"text-content\">\r\n      <b>Shri Surender Sharma</b> is the Vice President of Bhagwan Parshuram Institute of Technology as well as Bhartiya Brahmin Charitable Trust. He is a popular International Hindi poet (Hasyakavi). He sometimes uses the Marwari language for his humour as well. He is also famous in the literary circles in India. He is known to have caused many a laugh riots and an amazing fact about him is that he himself seldom laughs and maintains a poker face even when telling the most hilarious jokes. This demeanour is particularly liked by a lot of people, who find it very amusing.\r\n      <br>\r\n      In 2004, FM radio station, Red FM 93.5, started a daily show titled Sharmaji Se Poocho (Ask Mr. Sharma) featuring Surender Sharma. In this show, he gave prompt and humorous answers to callers questions.\r\n    </p>\r\n  </div>\r\n  <div class=\"trust\">  \r\n    <header class=\"trust__heading\">Patrons</header>      \r\n    <p id=\"text-content\">Shri Naval Kishore Sharma(1925-2012) , Hon'ble Governor of Gujarat(July 2004- July 2009)</p> <br> <br>\r\n  </div>\r\n  \r\n  <div class=\"trust\">    \r\n    <header class=\"trust__heading\">Promoters of the Trust</header>    \r\n    <p id=\"text-content\">\r\n      » Shri Atam Prakash Kaushik, Industrialist <br>\r\n      » Shri Narender Sharma, Indutrialist  <br> \r\n      » Shri Bhure Lal, Senior Civil Servant, Govt. of India <br>\r\n      » Shri Deep Chand Sharma, Chairman, DHFC, Govt. Of Delhi <br>\r\n      » Shri Vinod Vats, Businessman <br>\r\n      » Shri B.N. Sharma, Industrialist <br>\r\n      » Shri Jai Prakash Gaur, Industrialist & Chairman J.P. Univ. <br>\r\n      » Shri Surender Sharma, National Poet(Haasya Kavi) <br>\r\n      » Shri Bhagirath Sharma, Industrialist <br>\r\n      » Shri Shambhu Sharma, Industrialist <br>\r\n      » Shri Hari Niwas Bhardwaj, Businessman <br>\r\n      » Shri Mahavir Mudgal, Industrialist <br> \r\n      » Shri Parmanand Bhardwaj, Senior Advocate <br>\r\n    </p>\r\n  </div>\r\n  <br>\r\n\r\n  <div class=\"trust\">    \r\n  <header class=\"trust__heading\">Management</header>        \r\n    <p id=\"text-content\"> \r\n      » Shri Atam Prakash Kaushik(Chairman) <br>\r\n      » Shri Surender Sharma(Sr. Vice-President) <br>\r\n      » Shri Narender Sharma(Vice-President) <br>\r\n      » Shri Vinod Vats (General Secretary) <br>\r\n      » Shri B.N. Sharma(Secretary) <br>\r\n      » Shri Ram Babu Sharma <br>\r\n      » Shri Bhagirath Sharma <br>\r\n      » Shri Parmanand Bhardwaj <br>\r\n      » Shri Hari Niwas Bhardwaj <br>\r\n      » Shri Jagdish Prasad Sharma <br>\r\n    </p>\r\n  </div>\r\n  <br>\r\n\r\n  <div class=\"trust\">    \r\n    <header class=\"trust__heading\">Support from Academia and Industry</header>        \r\n    <p id=\"text-content\">\r\n      » Prof. P.B. Sharma\t:- Former Vice Chancellor, DTU & RGT Univ., Bhopal <br>\r\n      » Prof. R.Chandra\t:- Former Vice Chancellor, Meerut Univ. & Dean Faculty Of Technology, DU <br>\r\n      » Prof. S.S.Murthy\t:- Prof. and Former Head, Dept. of Electrical Engg., IIT-Delhi <br>\r\n      » Prof. A.P. Mittal\t:- Prof. and Head, Dept. of Instrumentation & control, NSIT, Delhi <br>\r\n      » Prof. D.R. Kohli\t:- Former Prof. and Head Dept Of Electrical Engg., IIT- Roorkee <br>\r\n      » Shri Vinod Mittal\t:- Chairman Balaji Group, New Delhi <br>\r\n      » Shri P.D. Sharma\t:- Former chairman, Century Textile Co. Ltd., Bangkok <br>\r\n      » Dr. A.K.Aggarwal\t:- Chief Executive Officer, Autometers Alliance Ltd., Noida <br>\r\n      » Dr. J.K.N. Sharma\t:- Former Scientist, National Physical Laboratory ( CSIR) Delhi <br>\r\n      » Sh. C.M. Vij\t:- Former Engineer-in-Chief, Municipal Corporation of Delhi <br>\r\n      »Sh. Asit Tandon\t:- General Manager, Airtel and Former General Manager, Siemens India <br>\r\n      » Sh. Manish Saldhi\t:- Manager, Microsoft, India <br>\r\n    </p>\r\n  </div>\r\n</div>\r\n"

